import React from "react";
import Typewriter from "typewriter-effect"
import "../Header/Header.css"
import  ImageHeader from "../asset/image_header2.png"


const Header = () => {

    return (
        <>

            <div className="Header-text">
                <div className="Header-text2">
                <img src={ImageHeader} alt="" />
                    <h3>ONLINE shopping time</h3>
                </div>
                <div className="Header-position">    
                    <Typewriter
                        options={{
                            autoStart: true,
                            loop: true,
                            delay: 50,
                            strings: [   
                                "Buat Hari Khusus Anda Lebih Spesial dengan Gift Box 😊",
                                `Berikan Hadiah yang Berarti dengan Gift Box Pilihan Kami🎁`,
                                "Hadiah yang Tepat untuk Semua Kesempatan, Temukan di Sini🛍️",
                                "Berikan Kejutan Terbaik dengan Gift Box Berkualitas Tinggi",
                                "Hadiah yang Unik dan Berkesan untuk Orang Tersayangmu",
                                "Berikan Hadiah Tak Terlupakan dengan Gift Box Kami"
                            ]
                        }}
                    />
                </div>
            </div>
            <div className="d-grid gap-2 col-2 mx-auto mt-5">
            <button type="button" className="color-button">Call</button>
            </div>

        </>
    )
}

// // Temukan Hadiah Terbaikmu dengan Gift Box Kami
// 
// 
// 
// 
// 
// 
// Hadiah yang Dapat Dikenang Selamanya, Ada di Gift Box Kami
// Jangan Lagi Bingung Mencari Hadiah, Gift Box Kami Solusinya
// Berikan Kejutan yang Dapat Dikenang dengan Gift Box Spesial dari Kami.

export default Header;
